void timeTaken(clock_t start, clock_t end, std::string sort_algo)
{
    double time_taken = double(end-start) / double(CLOCKS_PER_SEC);
    std::cout << "Time taken for " << sort_algo <<" : "<< std::fixed << time_taken << std::setprecision(5) << "sec" << std::endl;
}
void countingSortAlgo(int arr[], int size)
{
    //find the maxm number in the given array
    
    int i;
	int k = getMax(arr, size);
 

    // initializing arr of size k
    int count_arr[k] = {0};
    int final_arr[size] = {0};
    
    //first counting the repetation and filling the count_arr
    for(i = 0; i < size; i++)
        ++count_arr[arr[i]];
    
    // Updating the count_arr to the number of keys present in the array
    for (i = 1; i<=k ; i++)
        count_arr[i] += count_arr[i-1];
    
    // filling the temporary array 
    for(i=size-1; i>=0; i--)
        final_arr[--count_arr[arr[i]]] = arr[i];
	
	
	for(i =0; i < size; i++)
		arr[i] = final_arr[i];  
}

void countSort(int arr[], int size, int pos)
{
	int count_arr[10] = {0};
	int i;
	int final_arr[size] = {0};
	
	for(i =0; i < size; i++)
		++count_arr[(arr[i]/pos)%10];
	
	for(i = 1; i < 10; i++)
		count_arr[i] += count_arr[i-1];
		
	for(i = size-1; i>=0; i--)
		final_arr[--count_arr[(arr[i]/pos)%10]] = arr[i];
		
	for(i = 0; i<size; i++)
		arr[i] = final_arr[i];
		
}

void radixSort(int arr[], int size)
{
	int max = getMax(arr, size);
	for(int pos = 1; max/pos > 0; pos*=10)
		{
            std::cout << "Just entered" << std::endl;
            countSort(arr, size, pos);	}
}

int getMax(int arr[], int size)
{
	int temp = arr[0];
	for(int i =0; i < size; i++)
		if(arr[i]>temp)
			temp = arr[i];
	return temp;
}
